import React, { Component } from 'react'
import GoogleMapReact from 'google-map-react'

const API_KEY = "AIzaSyC6PUOxo26piQBw2RGg6uLjEtVQY4XzN9Y";

const dataTest = {
    position: [{
        "lng": "172.5178162",
        "lat": "-43.53422067",
        "latLng": "0", 
    },
    {
        "lng": "153.3947936",
        "lat": "-27.88541405",
        "latLng": "0", 
    },
    {
        "lng": "172.3789706",
        "lat": "-43.54945845",
        "latLng": "0", 
    },
    {
        "lng": "151.0270861",
        "lat": "-33.88505584",
        "latLng": "0", 
    },
    {
        "lng": "173.3607413",
        "lat": "-35.10000853",
        "latLng": "0", 
    },
    {
        "lng": "153.0189387",
        "lat": "-30.22149684",
        "latLng": "0", 
    },
    {
        "lng": "138.5963119",
        "lat": "-34.96244234",
        "latLng": "0", 
    },
    {
        "lng": "151.0278964",
        "lat": "-33.95605127",
        "latLng": "0"
    },
    {
        "lng": "151.4173011",
        "lat": "-27.47007787",
        "latLng": "0"
    },
    {
        "lng": "151.1213122",
        "lat": "-33.8771381",
        "latLng": "0"
    },
    {
        "lng": "176.7529046",
        "lat": "-38.02476884",
        "latLng": "0"
    },
    {
        "lng": "153.0625904",
        "lat": "-27.68422772",
        "latLng": "0"
    },
    {
        "lng": "145.7331054",
        "lat": "-17.01103673",
        "latLng": "0"
    }
]
}

export default class Heatmap extends Component {

    static defaultProps = {
        center: {
          lat: 59.95,
          lng: 30.33
        },
        zoom: 11,
        data: null
    };

    render() {
        return (
            <GoogleMapReact 
            bootstrapURLKeys={{
                key: [API_KEY],
                libraries:['visualization']
                }}
            defaultCenter={this.props.center}
            defaultZoom={this.props.zoom}>
            heatmap={{positions:dataTest.position, options: {
                radius: 2,
                opacity: 10}
            }}
            </GoogleMapReact>
        )
    }
}
